ok no issue we can add the uint test for getcorecount. see if it is not too time consuming u can set up the unit test for this class like this -

Class MockHandler : public oem_utils:Handler
{
Public:
	MockHandler() {}
MOCK_METHOD(void, setCoreCount, (const EntityAssociations&), (const EntityMaps));
}

That way you can use the same mock class and just add a mock method for getcorecount and use that mock method in your unit test.
